description:
The On Track Survey has been conducted annually since 2003. School leavers who attended school in the previous year and who agreed to participate in the survey are contacted in April-May to determine their post school destination.
The On Track survey seeks to: 
Offer a consistent and comprehensive approach to monitoring the transistions of school leavers; 
Report the information to schools, local government areas and other education providers and organisations concerned with assisting young people, policy makers, parents and students; 
Provide detailed analyses of the transistions experienced by different groups of leavers; 
Enable education providers to use the findings to monitor and improve their programs; and 
Provide a referral service for school leavers who appear to be experiencing difficulties in the transistion process.

Vicmap Property consists of data representing Victoria's land parcels and properties and is used extensively in Geographic Information Systems (GIS) by the public and private sectors. 

Vicmap Property Content includes
      · Parcel and Property Polygon views;
      · Parcel and Property Identifiers - parcel descriptors (including Standard Parcel Identifiers (SPI)), 
        Council reference numbers;
      · Registered and proposed (All proposals entered prior to July 2002 are non-polygonal and all 
        entered post July 2002 are polygonised) parcels;
      · Crown and Freehold land differentiation;
      · Cadastral Road Casements;
      · Easements (Note: all new easements are being captured for the whole State. Previously, only 
        easements in the metropolitan area were captured. There is no current program to review and 
        capture missing easements);
      · Unique Feature Identifiers, date stamps and data quality information.
Spatial Datasets comprising Vicmap Property are listed below.  See their metadata entries for more detailed metadata.
Annotation Text - Vicmap Property (ANNOTATION_TEXT);
Cadastral Area Boundary - Vicmap Property (CAD_AREA_BDY);
Easement - Vicmap Property (EASEMENT)
Centroid - Vicmap Property (CENTROID);
Parcel View - Vicmap Property (PARCEL_VIEW);
Property View - Vicmap Property (PROPERTY_VIEW);
Road Casement - Vicmap Property (ROAD_CASEMENT_POLYGON );
Unconnected Centroid - Vicmap Property (UNCONNECTED_CENTROID);
